import React from "react";

function Sum(a, b) {
  let sam;
  return (sam = a + b);
}

function Div() {
  let div;
  return (div = a / b);
}
function Sub() {
  let sub;
  return (sub = a - b);
}
function Mul() {
  let mul;
  return (mul = a * b);
}

export { Sum, Mul, Div, Sub };
